      message: ''
    };
  }

  showMessage = () => {
    this.setState({
      message: 'My react app is ready'
    });
  }

  render() {
    return (
      <div>
        <div className="Header">
          <h2>Mint</h2>
        </div>
        <Summary />
        <div className="Main-Container ">

        </div>
      </div>
    );
  }
}

export default Mint;
